import classes from './Button.module.scss';
import { Link } from 'react-router-dom';

function Button({ to, href, onClick, primary, children, ...passProps }) {
    let Comp = 'button';
    const props = {
        onClick,
        ...passProps,
    };

    if (to) {
        props.to = to;
        Comp = Link;
    } else if (href) {
        props.href = href;
        Comp = 'a'
    }

    return (
        <Comp className={classes.wrapper} {...props}>
            <span>{children}</span>
        </Comp>
    );
}

export default Button;
